import React from "react";
import { Link } from "react-router-dom";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button,
  Badge,
} from "reactstrap";
import SearchComp from "./Sea";

const Stadiums = () => {
  return (
    <div>
      <SearchComp />
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {Array(20)
          .fill(null)
          .map((el) => (
            <div>
              <Card style={{ width: "250px" }}>
                <CardImg
                  top
                  width="100%"
                  src="defaultStadium.jpg"
                  alt="Card image cap"
                />
                <CardBody>
                  <CardTitle>Card title</CardTitle>
                  <CardSubtitle>Card subtitle</CardSubtitle>
                  <CardText>Address</CardText>
                  <Link to="/stadium">
                    <Button color="success">Access</Button>
                  </Link>
                </CardBody>
              </Card>
            </div>
          ))}
      </div>
    </div>
  );
};

export default Stadiums;
